const MovieComp = (props) =>
{
  const [movie, setMovie] = useState({})

  useEffect(async () =>
  {
    setMovie(props.movie);

  },[props])

  return(<div style={{width:"300px", height : "250px", borderWidth : "5px", borderStyle : "solid", borderColor : "blue"}}>
        
        Name : {movie.Name} <br/> <br/>

        <img width = "140px" height = "200px" src={movie.Image} />
        <input type="button" value="Edit"/>
        <input type="button" value="Delete"/><br/>

      </div>)
}



export default MovieComp;
